css:
:focus {
  outline: none;
}
.pull-center {
  margin-left: auto;
  margin-right: auto;
}
.padded {
  padding: 10px;
}
ul.block,
div.block {
  margin-bottom: 10px;
}
div > ul.block:last-child,
div > div.block:last-child {
  margin-bottom: 0;
}
.inline-block,
.inline-block-tight {
  display: inline-block;
  vertical-align: middle;
}
.inline-block {
  margin-right: 10px;
}
.inline-block-tight {
  margin-right: 5px;
}
div > .inline-block:last-child,
div > .inline-block-tight:last-child {
  margin-right: 0;
}
.pull-right .inline-block {
  margin-right: 0;
  margin-left: 10px;
}
.pull-right .inline-block-tight {
  margin-right: 0;
  margin-left: 5px;
}
.pull-right > .inline-block:first-child,
.pull-right > .inline-block-tight:first-child {
  margin-left: 0;
}
.error {
  -webkit-animation: flash-error 0.3s ease-in;
}
@-webkit-keyframes flash-error {
  0% {
    background: #cc0000;
  }
  100% {
    background: auto;
  }
}
